import { makeStyles } from "@mui/styles";

export default makeStyles(() => ({
    root: {
        justifyContent: "center",
        alignItems: "center",
        backgroundColor: "blue",
        height: "100%",
        margin: "0",
    },
    text: {
        textAlign: "center",
    },
}));
